```c
void *to_upper(const char *str) 
{
    if (!str) return NULL;

    size_t len = 0;
    while (str[len]) len++;

    char *upper = malloc(len + 1);
    if (!upper) return NULL;

    for (size_t i = 0; i < len; i++) {
        if (str[i] >= 'a' && str[i] <= 'z') {
            upper[i] = str[i] - 32;
        } else {
            upper[i] = str[i];
        }
    }
    upper[len] = '\0';

    return upper;
}
```

